import React from 'react';
import ReactDOM from 'react-dom';

// const charactersLis = characters.map((character, i ) =>
//   // expression goes here:
// 	<img key={'character_' + i}> { character } </img>
// );

function changeImage(character) {
  const rand = Math.random([0]) < 0.5;
  character.target.setAttribute('src', rand(characters));
}


function Card(props) {
  
    return (
      <div className="card text-center">
        <div className="card-body">
          <button className="btn">

            <img 
            src={characters}
            width={'auto'} 
            height={'200px'} 
            onClick={changeImage}/>

          </button>
        </div>
      </div>
    );
  }

  

export default Card;
